import React, { useState } from 'react';
import axios from 'axios';

function UserEntry() {
  const [formData, setFormData] = useState({
    name: '',
    phoneNumber: '',
    address: '',
    amount:'',
    Deadline:'',
    Document:''
  });

  const handleChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:3005/users', formData);
      console.log(res.data);
      setFormData({
        name: '',
        phoneNumber: '',
        address: '',
        amount:'',
        Deadline:'',
        Document:''
      })
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className='Main-InputFlied'>
      <div className='Name_Phone_Address'>
      <label htmlFor="UserName">UserName:</label>
      <input type="text" name="name" placeholder="Name" value={formData.name} onChange={handleChange} />

      <label htmlFor="PhoneNumber">PhoneNumber:</label>
      <input type="text" name="phoneNumber" placeholder="Phone Number" value={formData.phoneNumber} onChange={handleChange} />

      <label htmlFor="Address">Address:</label>
      <input type="text" name="address" placeholder="Address" value={formData.address} onChange={handleChange} />
      </div>
      <div className='Amount_DeadLine_'>
      <label htmlFor="Amount">Amount:</label>
      <input type="text" name="amount" placeholder="amount" value={formData.amount} onChange={handleChange} />
      <label htmlFor="Deadline">Deadline:</label>
      <input type="text" name="Deadline" placeholder="Deadline" value={formData.Deadline} onChange={handleChange} />

      <label htmlFor="Document">Document:</label>
      <input type="text" name="Document" placeholder="Document" value={formData.Deadline} onChange={handleChange} />
      </div>
      </div>

      <button type="submit">Submit</button>
    </form>
  );
}

export default UserEntry;
